//get All coursefunction getAllCoursesForIndex() {    $.ajax({        url: '/api/lecturer/courses/findAll',        type: "GET",        datatype: "JSON",        data: '',        success: function (result) {            var option = '';            if(result!=''){                for (var i in result) {                    option += ' <div class="accordion-item"><h2 class="accordion-header" id="heading' + result[i].courid + '">';                    option += ' <button class="accordion-button collapsed" onclick="getStudentindex(' + result[i].courid + ')" style="font-weight:900" type="button" data-bs-toggle="collapse" data-bs-target="#collapse' + result[i].courid + '" aria-expanded="true" aria-controls="collapse' + result[i].courid + '">';                    option += '' + result[i].cournm + '</button>';                    option += '</h2>';                    option += '<div id="collapse' + result[i].courid + '" class="accordion-collapse collapse " aria-labelledby="headingOne' + result[i].courid + '" data-bs-parent="#accordionExample">';                    option += '<div class="accordion-body" id="accobody' + result[i].courid + '">';                    option += '</div></div></div>';                }            }            $("#accordionExample").html(option);        }    });};function getStudentindex(courid){    $.ajax({        url: '/api/lecturer/studentgroups/findAll/' + courid,        type: "GET",        datatype: "JSON",        data: '',        success: function (result2) {            console.log(result2);            var option2 = '';            // option2 += '<table id="index' + courid + '"  class="table table-vcenter card-table table-hover table-bordered display">';            option2 += '<table id="tabledb1" class="table table-vcenter card-table table-hover table-bordered display">';            option2 += '<thead>';            option2 += '<tr>';            option2 += '<th>No.</th>';            option2 += '<th>StudentGroup Name</th>';            option2 += '<th>Opening Date<br/><span>(YYYY-MM-dd)</span></th>';            option2 += '<th>Session</th>';            option2 += '<th>Shift</th>';            option2 += '<th>Branch</th>';            option2 += '<th>Campus</th>';            option2 += '<th>Location</th>';            option2 += '</tr>';            option2 += '</thead>';            for (var e in result2) {                option2 += '<tr>';                option2 += '<td >' + (+e+1) + '</td>';                option2 += '<td>' + result2[e].stugronm + '</td>';                option2 += '<td>' + result2[e].openingdate + '</td>';                if(result2[e].session === 'M'){                    option2 += '<td>Morning</td>';                }else if(result2[e].session === 'A'){                    option2 += '<td>Afternoon</td>';                }else{                    option2 += '<td>Evening</td>';                }                if(result2[e].shift === 0){                    option2 += '<td>Monday - Wednesday - Friday</td>';                }else{                    option2 += '<td>Tuesday - Thursday - Saturday</td>';                }                option2 += '<td>' + result2[e].branchnm + '</td>';                option2 += '<td>' + result2[e].campusnm + '</td>';                option2 += '<td>' + result2[e].address + '</td>';                option2 += '</tr>';            }            option2 += '<tbody>';            option2 += '</tbody>';            option2 += '</table>';            $('#accobody' + courid).html(option2);            if ($.fn.DataTable.isDataTable('table.display')) {                $('table.display').DataTable().destroy();            }            $('table.display').DataTable({                dom: '<"tabletil">Bfrtip',                bPaginate: false,                buttons: [                    {                        extend: 'excelHtml5',                        exportOptions: {                            columns: ':visible'                        }                    },                    {                        extend: 'pdfHtml5',                        exportOptions: {                            columns: ':visible'                        }                    },                    'colvis'                ]            });        }    });}$(document).ready(function () {    //show all course    getAllCoursesForIndex();});